import React from 'react';

const AnnounceBar = () => {
    return (
        <div className="announceBar">
            <svg>
                <img src="../resources/images/jp_logo-portfolio.svg" alt="logo" />
            </svg>
        </div>
    );
};

export default AnnounceBar;
